import React from 'react';
import '../styles/Global.css'; // Para usar os estilos de dashboard-container

const SmallUnicornBackground = () => {
  return (
    <div style={{
      position: 'absolute',
      top: 0,
      left: 0,
      width: '100%',
      height: '100%',
      overflow: 'hidden',
      zIndex: -1, // Garante que fique no fundo
      backgroundImage: 'url(/assets/ia.png)',
      backgroundRepeat: 'repeat',
      backgroundSize: '100px', // Tamanho pequeno
      opacity: 0.05, // Bem sutil
    }}>
    </div>
  );
};

export default SmallUnicornBackground;
